<?php

namespace App\Http\Controllers;

use App\Models\Instituciones;
use Illuminate\Http\Request;
use Illuminate\Routing\Controller;
use Illuminate\Support\Facades\DB;

class BrandingController extends Controller
{
    private function normalizeName(string $value): string
    {
        $upper = mb_strtoupper($value);
        $map = [
            'Á' => 'A', 'É' => 'E', 'Í' => 'I', 'Ó' => 'O', 'Ú' => 'U', 'Ü' => 'U', 'Ñ' => 'N',
        ];
        return strtr($upper, $map);
    }

    private function getTokenName(Request $request): ?string
    {
        $token = $request->bearerToken();
        if (!$token) {
            return null;
        }

        $tokenParts = explode('|', $token);
        $tokenId = $tokenParts[0] ?? null;
        if (!$tokenId) {
            return null;
        }

        $tokenRecord = DB::table('personal_access_tokens')->where('id', $tokenId)->first();
        if (!$tokenRecord || !isset($tokenRecord->name)) {
            return null;
        }

        return $tokenRecord->name;
    }

    private function resolveInstitucion(Request $request): ?Instituciones
    {
        $user = $request->user();
        $institucionId = $user->instituciones_id ?? null;

        if ($institucionId) {
            $inst = Instituciones::find($institucionId);
            if ($inst) {
                return $inst;
            }
        }

        $nameInst = $this->getTokenName($request);
        if (!$nameInst) {
            return null;
        }

        // Primero buscar exacto (si el token guarda el Nombre de la institución)
        $inst = Instituciones::where('Nombre', $nameInst)->first();
        if ($inst) {
            return $inst;
        }

        // Fallback: búsqueda parcial por si hay diferencias menores (tildes/mayúsculas)
        return Instituciones::where('Nombre', 'like', '%' . $nameInst . '%')->first();
    }

    private function logoPorInstitucion(?string $nameInst): ?string
    {
        $nameInst = $nameInst ? trim($nameInst) : '';
        if ($nameInst === '') {
            return null;
        }

        $n = $this->normalizeName($nameInst);
        $logoinst = null;
        if (str_contains($n, 'MARIA') && str_contains($n, 'LUISA') && str_contains($n, 'LUZIO')) {
            $logoinst = 
            'data:image/png;base64,';
            return $logoinst;
            
        }
        if (str_contains($n, 'FOLKLORE')) {
            $logoinst = 
            'data:image/png;base64,';
            return $logoinst;
        }
        if (str_contains($n, 'BELLAS') && str_contains($n, 'ART')) {
            $logoinst = 
            'data:image/png;base64,';
            return $logoinst;
        }

        return null;
    }

    private function ministerio(): ?string
    {
        $Logo =
        'data:image/png;base64,';

        return $Logo;

    }

    private function ministerioEscudo(): ?string
    {
        $Logo =
        'data:image/png;base64,';

        return $Logo;
    }

    public function assets(Request $request)
    {
        $inst = $this->resolveInstitucion($request);
        $nameInst = $inst?->Nombre ?? $this->getTokenName($request);

        $logoDb = $inst?->Logo;
        $logoDb = is_string($logoDb) ? trim($logoDb) : $logoDb;
        $logo = ($logoDb !== null && $logoDb !== '') ? $logoDb : $this->logoPorInstitucion($nameInst);

        return response()->json([
            'nameInst' => $nameInst,
            'instituciones_id' => $inst?->id ?? ($request->user()->instituciones_id ?? null),
            'logo' => $logo,
            'ministerio' => $this->ministerio(),
            'ministerioEscudo' => $this->ministerioEscudo(),
        ]);
    }

    public function ObtenerLogo(Request $request)
    {
        $inst = $this->resolveInstitucion($request);
        $nameInst = $inst?->Nombre ?? $this->getTokenName($request);
        $logoDb = $inst?->Logo;
        $logoDb = is_string($logoDb) ? trim($logoDb) : $logoDb;
        $logo = ($logoDb !== null && $logoDb !== '') ? $logoDb : ($this->logoPorInstitucion($nameInst) ?? '');

        return response((string) $logo, 200)
            ->header('Content-Type', 'text/plain; charset=utf-8');
    }

    public function ObtenerMinisterio(Request $request)
    {
        return response((string) ($this->ministerio() ?? ''), 200)
            ->header('Content-Type', 'text/plain; charset=utf-8');
    }

    public function ObtenerMinisterioEscudo(Request $request)
    {
        return response((string) ($this->ministerioEscudo() ?? ''), 200)
            ->header('Content-Type', 'text/plain; charset=utf-8');
    }
}
